import styled from 'styled-components';


const Footer = () => {
    const Footer = styled.footer`
    width: 90%;
    max-width: 1120px;
    margin: 0 auto;
    display:grid;
    place-items:center;
    background:white;`

    return <Footer>Copyright 2020. Designed and Developed by Irene K.</Footer>
}

export default Footer;
